        <div>
            {login ? (
                <h1>Welcome to the RosterHouse!</h1>
            ) : (
                <div>
                <h1>Welcome to the RosterHouse, Coach {user.first_name}!</h1>
                </div>
            )}
        </div>
    )
}
export default Home;
